package main

import "fmt"

func unique(s string) bool {
	// fmt.Println(s)
	for i, v := range s {
		for n := 0; n < i; n++ {
			if v == rune(s[n]) {
				return false
			}
		}
	}

	return true
}

func main() {
	str := "mjqjpqmgbljsphdztnvjfqwrcgsmlb"
	str = "bvwbjplbgvbhsrlpgdmjqwftvncz"
	str = ""
	// fmt.Println(unique("mjqj"))
	// fmt.Println(unique("jpqm"))
	marker := 14
	start := marker - 1
	for i := range str {
		if i > start {
			if unique(str[i-start-1 : i]) {
				fmt.Println(str[i-start:i], i)
				break
			}
		}

	}

	fmt.Println(str)
}
